  return (
    <div className="index-2">
      <div id="trigger"></div>
      <div />
      <Controller>
        <Scene
          duration={700}
          classToggle="slide-left-opacity"
          triggerElement="#trigger"
          indicators={true}
        >
          {(progress, event) => <div>event</div>}
        </Scene>
      </Controller>
    </div>
  );
};

export default Index2;
